import React from 'react';

function Track({ track: { name, artists }, addTrack }) {
  return (
    <div>
      <h3>{name}</h3>
      <div>
        <ul>
          {artists.map((artist) => (
            <li>{artist.name}</li>
          ))}
        </ul>
      </div>
      <button type='button' onClick={addTrack}>Add</button>
    </div>
  );
}

export default Track;
